import React from 'react'
import { 
    Pagination,
    Stack 
} from '@mui/material'
function AppPagination() {
  return (
    <div>
        <div>
        <Stack spacing={2}>
      <Pagination count={10} shape="rounded" />
      <Pagination count={10} variant="outlined" shape="rounded" />
    </Stack>
        </div>
    </div>
  )
}

export default AppPagination
